const compactToTwoSpace = (str:string) => {
  let result = ''
  for (let i = 0; i < str.length; i += 2) {
    result += str.substring(i, i + 2) + ' '
  }

  result = result.trim()
  return result
}

function fromHex (value) {
  return new Uint8Array(value.split(/[\s,]+/g).map(function (x) {
    return '0x' + x | 0
  }))
}
